export const getIconComponent = (iconName: string) => {
  switch(iconName) {
    case 'Users':
      return Users;
    case 'Gem':
      return Gem;
    case 'MapPin':
      return MapPin;
    case 'Award':
      return Award;
    case 'BookOpen':
      return BookOpen;
    case 'Shell':
      return Shell;
    case 'Music':
      return Music;
    case 'Leaf':
      return Leaf;
    default:
      return Award;
  }
};